import "./index.css";
import profileone from "../profilesimages/Brenda.jpg";
import profiletwo from "../profilesimages/Lavender.jpg";
import profilethree from "../profilesimages/Valentine.jpg";
import profilefour from "../imagesprofiles/Nakato.jpg";
import profilefive from "../imagesprofiles/Faith.jpg";




const Team = () => {
  return (
    <div>
      <div className="Meetus">
        <h2 className="meetus">Meet Us</h2>
        <div className="meet">
        <img src={profilefour} alt="Nakato" className="images"/>
        <img src={profilethree} alt="Valentine" className="images"/>
        <img src={profiletwo} alt="Lavender" className="images"/>
        <img src={profileone} alt="Brenda" className="images"/>
        <img src={profilefive} alt="Faith" className="images"/>
          </div>
          <div className="meet-details">
          <div>
          <h4>Nakato Musana</h4>
          <p>Data Analyst</p>
          {/* <img scr={profileone} alt="Brenda" className="images" /> */}
        </div>
        <div>
          <h4>Valentine Nkatha</h4>
          <p>Android Developer</p>
        </div>
        <div>
          <h4>Lavender Anyango</h4>
          <p>Software Developer</p>
        </div>
        <div>
          <h4>Brenda Khamali</h4>
          <p>Designer</p>
        </div>
        </div>
        <div>
          <h4>Faith Wanyioke</h4>
          <p>Product Manager</p>
        </div>
      </div>

    </div>
  );
};
export default Team;
